import ReactDOM from 'react-dom';
import Card from "./components/Cards.jsx"
import styles from "./style/hand";

const App=()=> {
  const card1={
    key:"1",
    value:"3",
    type:"D"
  }
  const card2={
    key:"2",
    value:"J",
    type:"D"
  }
  const cardList=[]

  cardList.push(card1)
  cardList.push(card2)


  return (
    <div  >
      {cardList.map(card=><Card 
      key={card.key}
      value={card.value}
      type={card.type}
     />)}

    </div>
  );
}

export default App;
